insert  into `app_algo_sysdetectitem`(`id`,`row`,`item`,`unit`,`reaction`,`item_hint`,`disease_id`,`disease_full`,`department`,`standard_range`,`version`,`is_del`,`create_at`) values (1,1,'白细胞','','采用粒细胞酯酶法','指标概念',4,'增高见于急性肾炎、肾盂肾炎、膀胱炎、尿道炎、尿道结核等','儿科','阴性、微量','1.0.1',0,'0000-00-00 00:00:00'),(2,2,'亚硝酸盐','','采用亚硝酸盐还原法','指标概念',4,'阳性见于膀胱炎、肾盂肾炎等。','儿科','阴性','1.0.1',0,'0000-00-00 00:00:00'),(3,3,'尿胆原','μmol/L','采用醛反应法或重氮反应法为原理','指标概念',3,'阳性见于溶血性黄疸、肝病等。阴性，见于梗阻性黄疸。','儿科','3.2-16','1.0.1',0,'0000-00-00 00:00:00'),(4,4,'蛋白质','','蛋白误差法','指标概念',1,'阳性见于各种急慢性肾小球肾炎、急性肾盂肾炎、多发性骨髓瘤、肾移植术后等。此外，药物，汞、铅等中毒引起肾小管上皮细胞损伤也可见阳性。','儿科','阴性、微量','1.0.1',0,'0000-00-00 00:00:00'),(5,5,'pH','','采用酸碱指示剂法','指标概念',5,'降低，见于酸中毒、痛风、糖尿病、发烧、白血病等。增高,见于碱中毒、输血后、严重呕吐、膀胱炎等。','儿科','5.0-8.5','1.0.1',0,'0000-00-00 00:00:00'),(6,6,'潜血','','采用红细胞类过氧化物酶法','指标概念',1,'阳性见于泌尿系统结石、感染、肿瘤、急慢性肾炎、血小板减少性紫癜、血友病等。','儿科','阴性、微量','1.0.1',0,'0000-00-00 00:00:00'),(7,7,'尿比重','Kg/L','采用多聚电解质离子解离法','指标概念',1,'增高见于急性肾炎、糖尿病、高热、呕吐、腹泻及心力衰竭等。降低，见于慢性肾炎、慢性肾盂肾炎、急慢性肾功衰竭及尿崩症等。','儿科','1.000-1.030','1.0.1',0,'0000-00-00 00:00:00'),(8,8,'酮体','','采用亚硝基铁氰化钠法','指标概念',2,'阳性见于糖尿病酮症、妊娠呕吐、子痫、腹泻、中毒、伤寒、麻疹、猩红热、肺炎、败血症、急性风湿热、急性粟粒性肺结、惊厥等。此外，饥饿、分娩后摄入过多的脂肪和蛋白质等也可出现阳性','儿科','阴性、微量','1.0.1',0,'0000-00-00 00:00:00'),(9,9,'胆红素','','偶氮反应为基本原理','指标概念',3,'阳性见于胆石症、胆道肿瘤、胆道蛔虫、胰头癌等引起的梗阻性黄疸和肝癌、肝硬化、急慢性肝炎、肝细胞坏死等导致的肝细胞性黄疸。','儿科','阴性','1.0.1',0,'0000-00-00 00:00:00'),(10,10,'葡萄糖','mmol/L','采用葡萄糖过氧化物酶法','指标概念',2,'阳性见于糖尿病、甲状腺机能亢进、垂体前叶机能亢进、铬细胞瘤、胰腺炎、胰腺癌、严重肾功能不全等。此外，颅脑外伤、脑血管意外、急性心肌梗塞等，也可出现应激性糖尿;过多食入高糖物后，也可产生一过性血糖升高，使尿糖阳性','儿科','阴性-5','1.0.1',0,'0000-00-00 00:00:00'),(11,11,'抗坏血酸','mmol/L','利用Vc的还原性','指标概念',5,'检测尿液维生素C的意义主要用于提示尿液隐血、胆红素、亚硝酸盐和葡萄糖检测结果是否准确，防止出现上述项目的假阴性结果。','儿科','阴性-2.8','1.0.1',0,'0000-00-00 00:00:00'),(12,12,'钙','mmol/L','采用钙络合物法','指标概念',5,'增高：见于在阳光下过多暴露、高钙血症、甲状旁腺功能亢进、甲状腺功能亢进、维生素D中毒、多发性骨髓瘤、白血病、恶性肿瘤骨转移、肾小管酸中毒，以及摄入氯化铰、降钙素、皮质类固醇、生长激素、甲状旁腺激素等药物。\n减低：见于妊娠晚期、低钙血症、甲状旁腺功能低下、维生素D缺乏、肾病综合征、急性胰腺炎、骨恶性肿瘤、甲状腺功能减低，以及摄入利尿剂、雌激素、新霉素、口服避孕药等药物','儿科','2.5-7.5','1.0.1',0,'0000-00-00 00:00:00'),(13,13,'肌酐','mmol/L','络合物法','指标概念',5,'增高：饥饿，发热，急慢性消耗笥疾病，剧烈运动后等。\n减低：肾衰，肌萎缩，贫血，白血病等。','儿科','0.9-26.5','1.0.1',0,'0000-00-00 00:00:00'),(14,14,'微量白蛋白','mg/L','Folin-酚试剂法','指标概念',1,'肾脏异常渗漏蛋白质，增高：见于糖尿病肾病、高血压、妊娠子痫前期，是肾损伤的早期敏感指标','儿科','10-30','1.0.1',0,'0000-00-00 00:00:00'),(15,15,'镁离子','mmol/24h','甲基麝香草酚蓝比色法','指标概念',5,'增高：肾脏疾病：凡影响肾小球滤过率者均可使尿镁滞留而增高，如急性或慢性肾功能衰竭、尿毒症、慢性肾炎少尿期等。内分泌疾病：如甲状腺功能减退症(黏液性水肿)、甲状旁腺功能减退症、阿狄森氏病和严重的糖尿病酸中毒等。其他原因：高血镁症还可见于多发性骨髓瘤、严重脱水、关节炎等疾病。此外，服用镁剂和草酸中毒等也会使尿镁增高。\n降低：镁由消化道丢失：如长期禁食、吸收不良、长期丢失胃肠液(慢性腹泻、吸收不良综合征、术后肠道瘘管和长期吸引胃液后等)以及严重呕吐。镁由尿路丢失：如慢性肾炎多尿期或长期用利尿剂治疗者。内分泌疾病：如甲状腺功能亢进症、甲状旁腺功能亢进症、糖尿病酸中毒、醛固酮增多症以及长期用皮质激素治疗后。','儿科','3.0-4.5','1.0.1',0,'0000-00-00 00:00:00'),(16,16,'钾离子','mmol/L','络合比色法','指标概念',5,'增高：见于饥饿初期、库欣综合征、原发性或继发性醛固酮增多症、肾性高血压、糖尿病酮症、原发性肾脏疾病，以及摄入促肾上腺皮质激素、两性霉素B、庆大霉素、青霉素。利尿剂等药物\n减低：见于艾迪生病、严重肾小球肾炎、肾盂肾炎、肾硬化、急性或慢性肾功能衰竭，以及摄入麻醉剂、肾上腺素、丙氨酸、阿米洛利等药物。尿钾低于20mmol/L与非肾性状态有关。','儿科','20','1.0.1',0,'0000-00-00 00:00:00'),(17,17,'铁离子','μmol／d','亚铁嗪法','指标概念',5,'增加：铁质沉着症（血色病），溶血性贫血，反复大量输血后等','儿科','0.1','1.0.1',0,'0000-00-00 00:00:00'),(18,18,'锌离子','mg/dL','采用络合比色法','指标概念',5,'升高：肾病综合征、蛋白尿症、尿毒症、高尿钙症、糖尿病、镰形细胞病、肾结石、肝脏病、服用氯噻酮或噻嗪类药后等。降低：饮食中缺锌。需要检查的人群：有水肿、腰痛、夜尿多、尿量过多或过少、贫血、乏力、嗜睡等症状的人群\"','儿科','0.01','1.0.1',0,'0000-00-00 00:00:00'),(19,19,'碘离子','μg/L','TMB显色法','指标概念',5,'减低见于地方性甲状腺肿、地方性克汀病（地方性呆小症）、甲状腺功能减退等。\n增高见于高碘性地方性甲状腺肿、甲状腺功能亢进、甲状腺炎以及服用碘剂（如长期服用乙胺碘呋酮等）过量者','儿科','100','1.0.1',0,'0000-00-00 00:00:00'),(20,20,'铜离子','μmol/24h','Cuprizone比色法','指标概念',5,'升高：肝豆状核变性、肝内或肝外胆汁淤积、胆汁性肝硬化、慢性活动性肝炎、使用青霉胺后等。','儿科','0.24-0.48','1.0.1',0,'0000-00-00 00:00:00');

/*Table structure for table `app_between` */

DROP TABLE IF EXISTS `app_between`;

CREATE TABLE `app_between` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(25) NOT NULL COMMENT '标题',
  `start` time NOT NULL COMMENT '开始时间',
  `end` time NOT NULL COMMENT '结束时间',
  `update_at` datetime NOT NULL COMMENT '更新时间',
  `version` varchar(5) NOT NULL COMMENT '版本控制',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

