/*Table structure for table `app_member` */

DROP TABLE IF EXISTS `app_member`;

CREATE TABLE `app_member` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(25) NOT NULL COMMENT '姓名',
  `add` text NOT NULL COMMENT '收货地址',
  `mem_type` tinyint(2) NOT NULL COMMENT '会员类别id',
  `create_time` datetime NOT NULL,
  `telephone` varchar(25) DEFAULT NULL COMMENT '会员手机号',
  `update_time` datetime NOT NULL,
  `end_time` datetime NOT NULL COMMENT '到期时间',
  `oid` varchar(25) NOT NULL COMMENT 'member_order id',
  `usr` varchar(100) NOT NULL COMMENT '推广id',
  `province` varchar(25) NOT NULL COMMENT '省',
  `city` varchar(25) NOT NULL COMMENT '市',
  `total` int(5) NOT NULL COMMENT '产品总数',
  `grant_num` int(5) NOT NULL COMMENT '已发放数量',
  `do_test` int(5) NOT NULL COMMENT '检测数',
  `contaminated` int(5) NOT NULL COMMENT '污染片',
  `is_del` tinyint(1) NOT NULL COMMENT '0:正常 1:删除',
  `pay` decimal(10,2) NOT NULL COMMENT '会员价格',
  `channel` tinyint(2) NOT NULL COMMENT '1:实体卡 2:支付订单 3:推广 支付订单',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=126 DEFAULT CHARSET=utf8;

