  `id` int(11) NOT NULL AUTO_INCREMENT,
  `channel` tinyint(2) NOT NULL COMMENT '1:系统消息',
  `receive` int(11) NOT NULL COMMENT '0:全局发送 对应接收id表',
  `text` text NOT NULL COMMENT '内容',
  `type` tinyint(2) NOT NULL COMMENT '类型 1:文本消息',
  `remarks` varchar(25) DEFAULT NULL COMMENT '备注',
  `create_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;

