insert  into `app_testrecord_mp3`(`id`,`item`,`path`,`create_at`,`update_at`,`isdel`,`text`) values (1,'LEU','mp3/result/LEU1.mp3','2019-02-27 10:29:08','2019-02-27 10:29:10',0,'白细胞异常的原因常见于泌尿系统疾病，如尿路感染，膀胱炎、肾盂肾炎、慢性肾炎。'),(2,'NIT','mp3/result/NIT2.mp3','2019-02-27 10:29:58','2019-02-27 10:29:59',0,'亚硝酸盐异常可能是正好吃一些包含这种盐的食物，也不排除是疾病因素，特别是大肠杆菌引起的肾盂、肾炎等疾病'),(3,'URO','mp3/result/URO3.mp3','2019-02-27 10:30:15','2019-02-27 10:30:16',0,'可能导致的原因如感冒发烧，新功能不全，便秘等'),(4,'PRO','mp3/result/PRO4.mp3','2019-02-27 10:31:04','2019-02-27 10:31:05',0,'蛋白质异常蛋白尿并非都是病态，有功能性蛋白尿和病理性蛋白尿之分。这需要复查一下的，病理性的蛋白尿临床上常见的是肾炎或是肾病综合症了。你的情况不排除是剧烈运动后所致。'),(5,'PH','mp3/result/PH5.mp3','2019-02-27 10:31:12','2019-02-27 10:31:14',0,'尿液的pH值增高，一般多于平时的饮食有关，也可能是饮水量少有关系'),(6,'BLO','mp3/result/BLO6.mp3','2019-02-27 10:31:27','2019-02-27 10:31:28',0,'潜血异常可能由于喂养不当，腹部着凉等导致。'),(7,'SG','mp3/result/SG7.mp3','2019-02-27 10:31:32','2019-02-27 10:31:34',0,'尿比重异常表示肾浓缩功能减退，见于尿崩症、慢性肾炎、精神性多饮多尿症等.单纯SG偏低，其他正常，可能是饮水多了点，不要担心。'),(8,'KET','mp3/result/KET8.mp3','2019-02-27 10:31:40','2019-02-27 10:31:42',0,'酮体异常可能是孩子整处于感冒发烧的阶段，等孩子身体恢复后自然就好了'),(9,'BIL','mp3/result/BIL9.mp3','2019-02-27 10:31:47','2019-02-27 10:31:49',0,'胆红素异常的原因是综合的，如母乳性、胃肠功能发育不完善、肝肝的排泄功能差等。'),(10,'GLU','mp3/result/GLU10.mp3','2019-02-27 10:31:55','2019-02-27 10:31:57',0,'葡萄糖低的话是没有严重问题的'),(11,'VC','mp3/result/VC11.mp3','2019-02-27 10:32:03','2019-02-27 10:32:04',0,'当摄入过多的VC时，会使结果呈阳性。由于维生素C 对尿液成分干化学自动分析有明显的干扰作用,一定要注意排除由VC阳性造成的尿潜血、葡萄糖、胆红素和亚硝酸盐等的假阴性结果。'),(12,'CA','mp3/result/CA12.mp3','2019-02-27 10:32:09','2019-02-27 10:32:11',0,'钙异常，可能由于平时吸收钙量过多'),(13,'CRE','mp3/result/CRE13.mp3','2019-02-27 10:32:15','2019-02-27 10:32:16',0,'肌酐值出现异常，可见于急性或慢性肾功能不全'),(14,'MCA','mp3/result/MCA14.mp3','2019-02-27 10:32:32','2019-02-27 10:32:33',0,'微量白蛋白异常的原因可能跟孩子的上呼吸道感染有关');

/*Table structure for table `app_testsrecord` */

DROP TABLE IF EXISTS `app_testsrecord`;

CREATE TABLE `app_testsrecord` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `home_id` int(11) NOT NULL COMMENT '家庭成员id',
  `area` varchar(100) NOT NULL COMMENT '地理位置 坐标',
  `picture_path` varchar(255) NOT NULL COMMENT '图片地址',
  `picture_record` text COMMENT '检测标识点图片',
  `app_version` varbinary(25) NOT NULL COMMENT 'app版本',
  `algo_version` varchar(25) NOT NULL COMMENT '算法版本库',
  `item_version` varchar(25) NOT NULL COMMENT '标准值版本库',
  `positionData` varchar(255) NOT NULL COMMENT '坐标点序列化数组',
  `code` varchar(100) NOT NULL COMMENT '编号',
  `model` varchar(5) NOT NULL COMMENT '型号',
  `come` tinyint(1) NOT NULL COMMENT '1医护版0家庭版',
  `app` tinyint(1) NOT NULL COMMENT '1安卓2ios3小程序',
  `state` tinyint(1) NOT NULL COMMENT '结果状态 1正常2轻3重',
  `is_import` tinyint(1) NOT NULL COMMENT '是否为导入的记录 1是 0否',
  `create_at_app` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '客户端扫码时间',
  `create_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `is_del` tinyint(1) NOT NULL COMMENT '0:正常 1:删除',
  `lailai` tinyint(2) NOT NULL COMMENT '懒懒扣 0:未连接 1:已连接',
  `type_between` tinyint(1) NOT NULL COMMENT '1:早尿 2:午尿 3:晚尿',
  `no_term` int(5) NOT NULL COMMENT '异常项个数',
  `phone_model` varchar(25) NOT NULL COMMENT '手机型号',
  `title` varchar(255) DEFAULT NULL COMMENT '备注标题',
  `phone_model_local` varchar(25) DEFAULT NULL COMMENT '详细手机型号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=580 DEFAULT CHARSET=utf8;

