/*Table structure for table `app_user` */

DROP TABLE IF EXISTS `app_user`;

CREATE TABLE `app_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `token` varchar(255) DEFAULT NULL,
  `name` varchar(25) NOT NULL COMMENT '昵称',
  `phone` varchar(25) NOT NULL COMMENT '手机号',
  `password` varchar(50) NOT NULL COMMENT '密码',
  `unionid` varchar(255) DEFAULT NULL COMMENT '微信id',
  `position` varchar(255) DEFAULT NULL COMMENT '位置坐标',
  `province` varchar(100) DEFAULT NULL COMMENT '省',
  `city` varchar(100) DEFAULT NULL COMMENT '城市',
  `district` varchar(100) DEFAULT NULL COMMENT '区、县',
  `addr` text COMMENT '位置详情',
