  `create_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `last_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最后登录时间',
  `is_del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:正常 1:删除',
  `member_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '会员等级 0:无',
  `active` float NOT NULL COMMENT '积分',
  `official_token` varchar(255) NOT NULL COMMENT '推广唯一识别',
  `app` tinyint(1) NOT NULL COMMENT '1:安卓 2:ios',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8;

