/*Table structure for table `app_user_add` */

DROP TABLE IF EXISTS `app_user_add`;

CREATE TABLE `app_user_add` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL COMMENT '用户id',
  `province` varchar(25) NOT NULL COMMENT '省',
  `city` varchar(25) NOT NULL COMMENT '市',
  `area` varchar(25) NOT NULL COMMENT '区',
  `text` text COMMENT '详情地址',
  `name` varchar(25) NOT NULL COMMENT '收货姓名',
  `add_tel` varchar(25) NOT NULL COMMENT '收货手机号',
  `create_at` datetime NOT NULL COMMENT '创建时间',
  `update_at` datetime NOT NULL COMMENT '修改时间',
  `is_del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:正常 1:删除',
  `is_default` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1:默认',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=92 DEFAULT CHARSET=utf8;

