于2000年7月—2003年12月于美国印第安那大学医学院做高级访问学者/博士后研究。兼任湖南省儿科学会副主任委员，中国中西医结合儿科学会委员，湖南省中医药和中西医结合儿科学会副主任委员，湖南省健康管理学会儿童健康管理专业委员会副主任委员，湖南省医学教育科技学会儿科医学教育专业委员会副主任委员。湖南省重点学科-小儿心血管专业学科带头人。曾兼任中华全国青年联合会第九届委员。被聘为《中国当代儿科杂志》等5种杂志编委。主持国家自然科学基金2项。已发表科研论文190余篇，其中SCI引录21篇。获得省科技进步奖1项，省医学科技奖3项。主编专著2部，副主编专著2部，参编专著19部。已培养毕业博士生12名，硕士生22名。',0,1,0,2,0),(265,'13548609556','c0bc76e5cde74af3d169adcfd7f93c94',55,49,4,'2018-10-03 12:19:29','李欣',2,'http://adm.puzezhongkang.com/uploads/images/lailai.png','','','',0,1,0,2,0),(266,'15211435638','d99045130c883e43e9afbb6e497554e4',55,49,5,'2018-10-03 12:20:09','卿霞',2,'http://adm.puzezhongkang.com/uploads/images/lailai.png','','','',0,1,0,2,0),(267,'18570511872','38e1e7e144d51c1394b33650486978eb',55,49,5,'2018-10-03 12:20:55','张贻永',2,'http://adm.puzezhongkang.com/uploads/images/lailai.png','','','',0,1,0,2,0),(268,'15211327326','6a81937a0134b32934063ec6dd92b620',55,49,5,'2018-10-03 12:21:33','程文静',2,'http://adm.puzezhongkang.com/uploads/images/lailai.png','','','',0,1,0,2,0),(269,'18390937740','c40be698019b42b2e9c6ef40004c5bf8',55,49,5,'2018-10-03 12:22:17','朱杏',2,'http://adm.puzezhongkang.com/uploads/images/lailai.png','','','',0,1,0,2,0),(270,'18397608935','84a14663e42b83b0122fb7ad9d96e603',55,49,5,'2018-10-03 12:22:55','罗茜',2,'http://adm.puzezhongkang.com/uploads/images/lailai.png','','','',0,1,0,2,0),(271,'18692751322','a9e5d49e63e5bbf2acc95aaffa3f5dcf',55,49,5,'2018-10-03 12:23:28','刘亚明',1,'http://adm.puzezhongkang.com/uploads/images/lailai.png','2cf80db74827608f45aba3ac3c960d17','','',0,1,0,2,0),(272,'18073049549','f201a2e7cde0adb7c85756ae9e88d26c',55,49,5,'2018-10-03 12:24:01','胡雪芳',2,'http://adm.puzezhongkang.com/uploads/images/lailai.png','','','',0,1,0,2,0),(273,'15709281108','7b32352f50100daae006457ca51a1a34',55,49,5,'2018-10-03 12:24:31','程琳',2,'http://adm.puzezhongkang.com/uploads/images/lailai.png','','','',0,1,0,2,0),(274,'17373239325','90ed117689dde4589a7ad554bc6639b4',55,49,5,'2018-10-03 12:25:01','雷敏',2,'http://adm.puzezhongkang.com/uploads/ima