/*Table structure for table `sch_classproduct` */

DROP TABLE IF EXISTS `sch_classproduct`;

CREATE TABLE `sch_classproduct` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `number` varchar(255) DEFAULT NULL COMMENT '商品编号',
  `title` varchar(100) DEFAULT NULL COMMENT '标题',
  `title_fit` varchar(100) DEFAULT NULL COMMENT '副标题',
  `price` varchar(100) DEFAULT NULL COMMENT '价格',
  `sale` varchar(100) DEFAULT NULL COMMENT '销售',
  `sort` varchar(10) DEFAULT NULL COMMENT '排序',
  `is_recommend` tinyint(2) DEFAULT NULL COMMENT '是否推荐',
  `is_show` tinyint(2) DEFAULT NULL COMMENT '是否展示',
  `is_onoff` tinyint(2) DEFAULT NULL COMMENT '是否可报名',
  `image1` varchar(255) DEFAULT NULL COMMENT '上传图片',
